  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this study is to provide
  Hurricane Island Outward Bound School with a document that to be used for internal
  planning purposes. In addition, it could serve as a vehicle for discussion for use
  agreements between Cross Island co-owners, Thomas Cabot and the U.S. Fish and Wildlife
  Service. The evaluation included investigations of attitudes concerning use, past
  and current use patterns. Additionally, the physical facilities including, buildings,
  trails, waste disposal and water supply were evaluated for recommended Improvements.\",\n\t\"license_title\":
